// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 < 0.9.0;

contract quiz1 {
    modifier numMoreThan5(uint _num)  {
        require(_num<=5, "_num must be more than 5");
        _;
    }

    function value(uint _num) public pure numMoreThan5(_num) returns(uint) {
        return _num;
    }
}

contract quiz2 {
    function minus10(uint _num) public pure returns(uint) {
        require(_num>10, "");
        return _num -10;
    }

    function pl10(uint _num) public pure returns(uint) {
        require(_num>10, "");
        return _num -10;
    }


}

